import './App.css';
import Navbar from './Components/Navbar/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Shop from './Pages/Shop/Shop';
import ShopCategories from './Pages/ShopCategories/ShopCategories';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path='/' element={<Shop />}/>
        <Route path='/mans' element={<ShopCategories ca />}/>
        <Route path='/womens' element={<ShopCategories />}/>
        <Route path='/kids' element={<ShopCategories />}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
